import './App.css';
import React from 'react';
import About from './components/about/about'
import Exp from './components/experience/experience'
import Cont from './components/contact/contact'
import logo from './logo.png'
import Home from './components/home/home'
import{ Routes, Route} from "react-router-dom";
import Navbar from './Navbar'



function App() {
  return (
    <div className="App">

      <mybar className="App-header">
        <img src={logo} className="App-logo" alt="logo" >


        <Navbar/>
        <Routes>
          <Route path="/" element={<Home/>}/>
          <Route exact path="/components/about/about" element={<About/>}/>
          <Route exact path="/components/experience/experience" element={<Exp/>}/>
          <Route exact path="/components/contact/contact" element={<Cont/>}/>

        </Routes>

        </img>


      </mybar>



    </div>
  );
}

export default App;
